import debounce from "lodash.debounce";
import * as d3 from "d3";
import * as topojson from "topojson";

console.log("visuals are loaded");

export function init(audioset) {
  console.log("visuals init", audioset.id);
  d3.select("*");
  debounce(() => {
    topojson.topology();
  });
}
